package Model;import javafx.scene.control.Button;import javafx.scene.image.Image;import javafx.scene.image.ImageView;public class Admin {	private String srNo;	private String name;	private String phone;	private String email;	private String id;	private String house;	private String city;	private String age;	private String cnic;	private Button viewButton;	private Button editButton;	private Button deleteButton;		public Admin ( String srNo, String name, String phone, String email, String id, String house, String city, String age, String cnic, Button viewButton, Button editButton, Button deleteButton ) {				this.srNo = srNo;		this.name = name;		this.phone = phone;		this.email = email;		this.id = id;		this.house = house;		this.city = city;		this.age = age;		this.cnic = cnic;		Image viewImage = new Image("C:\\Users\\seith\\IdeaProjects\\demo2\\src\\main\\resources\\sample\\demo2\\Images\\ViewEye.png");		ImageView imageView = new ImageView(viewImage);		imageView.setFitWidth(16);		imageView.setFitHeight(16);		viewButton.setGraphic ( imageView );		this.viewButton = viewButton;		viewImage = new Image ( "C:\\Users\\seith\\IdeaProjects\\demo2\\src\\main\\resources\\sample\\demo2\\Images\\EditPen.png" );		imageView = new ImageView (viewImage);		imageView.setFitWidth(16);		imageView.setFitHeight(16);		editButton.setGraphic ( imageView );		this.editButton = editButton;		viewImage = new Image ( "C:\\Users\\seith\\IdeaProjects\\demo2\\src\\main\\resources\\sample\\demo2\\Images\\DeleteTrash.png" );		imageView = new ImageView (viewImage);		imageView.setFitWidth(16);		imageView.setFitHeight(16);		deleteButton.setGraphic ( imageView );		this.deleteButton = deleteButton;	}		public String getSrNo () {		return srNo;	}		public void setSrNo ( String srNo ) {		this.srNo = srNo;	}		public String getName () {		return name;	}		public void setName ( String name ) {		this.name = name;	}		public String getPhone () {		return phone;	}		public void setPhone ( String phone ) {		this.phone = phone;	}		public String getEmail () {		return email;	}		public void setEmail ( String email ) {		this.email = email;	}		public String getId () {		return id;	}		public void setId ( String id ) {		this.id = id;	}		public String getHouse () {		return house;	}		public void setHouse ( String house ) {		this.house = house;	}		public String getCity () {		return city;	}		public void setCity ( String city ) {		this.city = city;	}		public String getAge () {		return age;	}		public void setAge ( String age ) {		this.age = age;	}		public Button getViewButton () {		return viewButton;	}		public void setViewButton ( Button viewButton ) {		Image viewImage = new Image("Images/ViewEye.png");		ImageView imageView = new ImageView(viewImage);		imageView.setFitWidth(15);		imageView.setFitHeight(15);		viewButton.setGraphic ( imageView );		this.viewButton = viewButton;	}		public Button getEditButton () {		return editButton;	}		public void setEditButton ( Button editButton ) {		Image viewImage = new Image("Images/EditPen.png");		ImageView imageView = new ImageView(viewImage);		imageView.setFitWidth(15);		imageView.setFitHeight(15);		editButton.setGraphic ( imageView );		this.editButton = editButton;	}		public Button getDeleteButton () {		return deleteButton;	}		public void setDeleteButton ( Button deleteButton ) {		Image viewImage = new Image("Images/Trash.png");		ImageView imageView = new ImageView(viewImage);		imageView.setFitWidth(15);		imageView.setFitHeight(15);		deleteButton.setGraphic ( imageView );		this.deleteButton = deleteButton;	}		public String getCnic () {		return cnic;	}		public void setCnic ( String cnic ) {		this.cnic = cnic;	}}